import React, { Fragment, useEffect, useState, useContext } from "react";
import { AuthContext } from "../../Helpers/AuthContext";
import Axios from "axios";

import { Row, Col, Button, Nav, Form, Alert } from "react-bootstrap";


import Ads from "../Ads";


function User() {
  const { authState, setAuthState } = useContext(AuthContext);


  return (
    <AuthContext.Provider value={{ authState, setAuthState }}>
    <div>
    <Row className="mx-auto p-5">
          <Col lg={10} md={10} sm={12}>
          <div>
                  <div class="fs-6 fw-bold ">Web Application Development Intern </div>
                  <div>Interviewer: Netizen Experience</div>
                  <div class="d-none d-sm-block"><a href="https://meet.google.com/xsh-gmxp-qbr" class="text-decoration-none">https://meet.google.com/xsh-gmxp-qbr</a></div>  
                  <div class="d-block d-sm-none">Link: <a href="https://meet.google.com/xsh-gmxp-qbr" class="text-decoration-none">Click Here</a></div> 
                  <div>10:00 AM (November 14, 2021)</div>
              </div>
          </Col>
          <Col lg={2} md={2} sm={12} className="px-1 py-3 my-1 mx-auto">
            <Ads />
          </Col>
          </Row>
    </div>
    </AuthContext.Provider>
  )
}

export default User
